import React from 'react';
import './App.css';

const achievements = [
  {
    title: "Google Girl Hackathon Finalist",
    description: "Finalist in the Google Girl Hackathon 2024 for developing a model for semantic segmentation of flood images.",
  },
  {
    title: "ICPC Asia-Kanpur Prelims",
    description: "Achieved a global rank of 1111 in ICPC Asia-Kanpur Prelims Contest.",
  },
  {
    title: "Scholarships & Recognitions",
    description: "Received multiple scholarships and recognitions for academic excellence and tech contributions.",
  },
  // Add more achievements as needed
];

const Achievement = () => {
  return (
    <div className="achievement-container">
      <h2 className="achievement-heading">Achievements</h2>
      <div className="achievement-grid">
        {achievements.map((achievement, index) => (
          <div className="achievement-box" key={index}>
            <h3 className="achievement-title">{achievement.title}</h3>
            <p className="achievement-description">{achievement.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Achievement;
